import React from 'react';
import video from './MV.mp4';

function BackgroundVideo({ className }) {
	return (
		<div className={`flex flex row h-screen overflow-hidden items-center justify-center bg-black-50 absolute ${className}`}>
      <video autoPlay loop muted className="min-h-screen min-w-max">
        <source src={ video } type="video/mp4" />
      </video>   
    </div>
	);
}

export default BackgroundVideo;
